    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT - 39 / col0 + ( col1 ) BETWEEN + - col1 / col2 + + 0 AND - + CAST ( col2 AS INTEGER ) + - + 49 * + - col2;
  - name: tab2

outputs:
  - name: q8816.out
    data: |
